=Write a short 2-paragraph retirement summary using this info:

Name: {{ $('Webhook').item.json.body.Name }}
Age: {{ $('Webhook').item.json.body.Age }}
Income: {{ $('Webhook').item.json.body.Income }}
Retirement Savings: {{ $('Webhook').item.json.body.Savings }}
Retirement Age Goal: {{ $('Webhook').item.json.body['RetireAge'] }}
Lifestyle Goal: {{$json["lifestyle"]}}

Before finishing the message, double check it to make sure contradicting ideas are not present. For example, If somebody has no retirement savings, do not say "A market crash could wipe out your savings."

=Given the following retirement insight and user data, generate 2 short, specific follow-up questions that feel personal. The goal is to help them reflect deeper on their current financial position. Questions should be focused, clear, and easy to answer.

Insight:
{{ $json.message.content }}
User Data:
Name: {{ $('Webhook').item.json.body.Name }}
Age: {{ $('Webhook').item.json.body.Age }}
Income: {{ $('Webhook').item.json.body.Income }}
Retirement Savings: {{ $('Webhook').item.json.body.Savings }}
